import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios'

const DaftarMenu = ({aktif}) => {

	const [kategoriMenu, setKategoriMenu] = useState();

	useEffect(() => {
		axios
			.get("http://localhost:3004/" + "products?category.nama=" + aktif)
			.then((response) => {
				// handle success
				setKategoriMenu(response)
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}, [aktif])

	console.log(kategoriMenu)

